import 'bootstrap/dist/css/bootstrap.min.css';
import './Login1.css';
import { Link } from 'react-router-dom';
import { useState } from 'react';



function Login1() {

const [isToger,setToger] = useState(true);

const [FirstName, setFirstName] = useState('');
const [LastName, setLastName] = useState('');
const [Email, setEmail] = useState('');
const [Phone, setPhone] = useState('');
const [Password, setPassword] = useState('');
const [Title, setTitle] = useState('');
const [Slogan, setSlogan] = useState('');
const [Uri, setUri] = useState('');

const loginF = async (e) => {
    e.preventDefault();
    console.log(FirstName);
}

    return (
    <div className='body'>
    <div className="row">
        <img src='backImg.png' className='col-md-6 d-none d-md-flex img '/>
        <div className="col-lg-6 p-5">
            <div className='titre' ><img src='Nexadz.png' width={140} height={30}/></div>

            {/* la formulaire 1 */}
            {isToger &&  <form className='frm'>
                <div class="mt-3">
                    {/* <div class="form-label d-flex justify-content-start " >First name</div> */}
                    <input type="text" class="form-control" placeholder='First name' onChange={(e) => setFirstName(e.target.value)}/>
                </div>
                <div class="mt-3">
                    {/* <label class="form-label d-flex justify-content-start">First name</label> */}
                    <input type="text" class="form-control" placeholder='Last Name' onChange={(e) => setLastName(e.target.value)}/>
                </div>
                <div class="mt-3 ">
                    {/* <label class="form-label d-flex justify-content-start">Email</label> */}
                    <input type="email" class="form-control" placeholder='Email' onChange={(e) => setEmail(e.target.value)}/>
                </div>
                <div class="mt-3 ">
                    {/* <label class="form-label d-flex justify-content-start">Phone number</label> */}
                    <input type="text" class="form-control" placeholder='Phone number' onChange={(e) => setPhone(e.target.value)}/>
                </div>
                <div class="mt-3 ">
                    {/* <label class="form-label d-flex justify-content-start">Password</label> */}
                    <input type="password" class="form-control" placeholder='Password' onChange={(e) => setPassword(e.target.value)}/>
                </div>
                <div class="mt-3 ">
                    {/* <label class="form-label d-flex justify-content-start">Confirm password</label> */}
                    <input type="password" class="form-control" placeholder='Confirm password'/>
                </div>
                <div class="row mt-3 p-3 d-flex justify-content-center">
                     <button className='btn btn-primary col-4 ms-3 ' > Reset </button>
                     <button className='btn btn-primary col-4 ms-3 ' onClick={()=>setToger(!isToger)}> Next </button>
                </div>
               
            </form>}

            {/* La formulaire 2 */}
            {!isToger && 
            <form className='frm' action='' >
                <div class="mt-3">
                    {/* <div class="form-label d-flex justify-content-start hh" style={{ display: "none" }}>First name</div> */}
                    <input type="text" class="form-control" placeholder='Title' onChange={(e) => setTitle(e.target.value)}/>
                </div>
                <div class="mt-3">
                    {/* <label class="form-label d-flex justify-content-start">First name</label> */}
                    <input type="text" class="form-control" placeholder='Slogan'/>
                </div>
                <div class="mt-3 row d-flex justify-content-start">
                    {/* <label class="form-label d-flex justify-content-start">Email</label> */}
                    <div class="col-9"><input type="text" class="form-control" placeholder='URl' onChange={(e) => setUri(e.target.value)}/></div>
                    <div class="col-3"><input type="text" class="form-control" placeholder='.adz' disabled/></div>
                </div>

                <div class="mt-3 ms-1 row d-flex justify-content-start form-control p-0">
                    {/* <label class="form-label d-flex justify-content-start">Email</label> */}
                    <input type="file" class="form-control inpt" id="kk" />
                    <div class="col-3"><label type="text" class="form-control bg-light text-muted com" for="kk">Upload</label></div>
                    <div class="col-9"><label type="text" class="form-control text-muted com" for="kk">No file</label></div>
                </div>


                
                <div class="row mt-3 p-3 d-flex justify-content-center">
                    <button className='btn btn-primary col-3 ms-3' onClick={()=>setToger(!isToger) }>Back</button>
                    <button className='btn btn-primary col-3 ms-3 ' > Reset </button>
                    <Link className='btn btn-primary col-3 ms-3' to={"/Acc"} onClick={loginF} > Next </Link>
                </div>
               
            </form>}




        </div>
    </div>
       
    </div>
    );
  }
  
  export default Login1;
